class Solution:
    def isAnagram(self, s: str, t: str) -> bool:
        x = self.init_list(s)
        y = self.init_list(t)
        return x == y

    def init_list(self, s):
        li = [0] * 26
        for i in s:
            li[ord(i) - 97] += 1

        return li


if __name__ == '__main__':
    s = Solution()
    a = ""
    b = ""
    print(s.isAnagram(a, b))
